INSERT INTO `tb_task` VALUES ('31', '1', 'eds_social_student', null, 'insert overwrite table bigdata_eds.eds_social_student\nselect a.studentid as id,b.studentname as social_person,cast(b.studentid as string) as social_id,concat(\'20\',substr(a.studentid,1,2),\'-07-01\') as time,\'宿舍关系\' as social_type,\na.rdormid as social_node,\'正常\' as social_status\n\nfrom bigdata_ld.studentroom a  join bigdata_ld.studentroom b on a.rdormid=b.rdormid', '1', 'HIVE', null, null, null, null, null, null, null, '0 45 3 ? * *', null, '2018-05-18 17:49:23', '2018-05-18 17:49:38', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('32', '1', 'eds_buddy_student', null, 'insert overwrite table bigdata_eds.eds_buddy_student  \n\nselect a.studentid as id,case when b.chinesename is null then b.englishname else b.chinesename end as social_person,a.buddy as social_id,case when substr(a.studentid,1,2) <50 then concat(\'20\',substr(a.studentid,1,2),\'-07-01\') else concat(\'2000\',\'-07-01\') end as time,\'buddy\' as social_type,\nnull as social_node,\'正常\' as social_status\n\nfrom bigdata_eds.student_buddy a join bigdata_dw.dm_student_id_new b on a.buddy=b.id\nleft join bigdata_dw.dm_student_id_new d  on a.studentid=d.id', '1', 'HIVE', null, null, null, null, null, null, null, '0 45 4 ? * *', null, '2018-05-18 17:50:37', '2018-05-18 19:20:57', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('33', '1', 'eds_xjtlu_club_online', null, 'insert overwrite table bigdata_eds.eds_xjtlu_club_online\n\nSELECT\n                a.adaccount,\n                a.CHINESENAME,\n                a.ENGLISHNAME,\n                d.id AS club_id,\n                e.title,\n                e.title_cn\nFROM\n                bigdata_ld.studentinfo_extend a\nJOIN bigdata_ld.club_users b ON upper(rtrim(ltrim(a.adaccount))) = upper(rtrim(ltrim(b.adaccount)))\nJOIN bigdata_ld.club_member c ON c.user_id = b.id\nAND c.approve = 3\nJOIN bigdata_ld.club d ON d.id = c.club_id\nAND d.\\`status\\` = 1\nLEFT JOIN bigdata_ld.club_description e ON d.id = e.club_id', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 4 ? * *', null, '2018-05-18 17:52:07', '2018-05-18 17:52:20', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('34', '1', 'eds_club_student', null, 'insert overwrite table bigdata_eds.eds_club_student\nselect b.id,case when c.chinesename is null then c.englishname else c.chinesename end social_person,d.id as social_id,\ncase when substr(b.id,1,2) <50 then concat(\'20\',substr(b.id,1,2),\'-07-01\') else concat(\'2000\',\'-07-01\') end as time,\n\'社团关系\' as social_type,a.title as social_node,\'正常\' as social_status\n\nfrom bigdata_eds.eds_xjtlu_club_online a join bigdata_eds.eds_xjtlu_club_online c on a.club_id=c.club_id\n\nleft join  bigdata_dw.dm_student_adaccount  b  on  rtrim(ltrim(upper(a.adaccount))) = rtrim(ltrim(upper(b.ADACCOUNT)))\nleft join  bigdata_dw.dm_student_adaccount  d  on  rtrim(ltrim(upper(c.adaccount))) = rtrim(ltrim(upper(d.ADACCOUNT)))', '1', 'HIVE', null, null, null, null, null, null, null, '0 40 4 ? * *', null, '2018-05-18 17:53:15', '2018-05-18 19:42:59', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('37', '1', 'eds_m_student_spr_all', null, 'insert overwrite TABLE bigdata_eds.eds_m_student_spr_all\nselect id,\nCHINESENAME,\nENGLISHNAME,\nADACCOUNT,\nMOA_CODE,\nMOA_SNAM,\nSTS_CODE,\nSTS_NAME,\nROU_CODE,\ncase when ROU_CODE1=\'P\' then \'硕士生\' \nwhen ROU_CODE1=\'R\' then \'博士生\' \nelse \'本科生\' end  ROU_CODE1\n,\nLEVEL_CN,\nPRG_CODE,\nPRG_NAME_CN,\nPRG_NAME_EN,\nSCE_OCCL,\nSCE_BLOK,\nDPT_CODE,\nDPT_NAME_CN,\nDPT_NAME_EN,\nROU_NAME_CN,\nROU_NAME_EN,\nSPR_SDATE,\nSPR_EDATE,\nSPR_AWDD,\ncase when SPR_GEND=\'F\' then \'女性\'\nwhen SPR_GEND=\'M\' then \'男性\'\nelse null \nend as SPR_GEND,\nSPR_DOB,\nSTUDENT_TYPE,\nETH_CODE,\nETH_NAME_CN,\nETH_NAME_EN,\ncase when FROM_REGION=\'NL1\' then \'国外\'\nwhen FROM_REGION=\'NL2\' then \'港澳台\'\nwhen FROM_REGION=\'LOCAL\' or FROM_REGION=\'LOCOL\' then \'内地\'\nelse FROM_REGION end FROM_REGION,\nSTU_NATC,\nFROM_NAT_NAME,\nFROM_PROVINCE,\nFROM_CITY,\nSTU_ISAR,\nSTU_IELR,\nADD_TEL3,\nADD_TELN,\nSNK_HTEL,\nSNK_HAT3,\nADD_EMAD,\nPRS_EMAD,\nPRS_NAME,\nPRS_ADDR,\nPRS_ITEL\n\nfrom  bigdata_ld.m_student_spr_all', '1', 'HIVE', null, null, null, null, null, null, null, '0 45 3 ? * *', null, '2018-05-18 17:57:20', '2018-05-18 17:57:32', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('38', '1', 'eds_LIBRARY_jl_student', null, 'insert overwrite table bigdata_eds.eds_LIBRARY_jl_student  \n\nselect a.id,b.social_person,b.id,a.optime,a.social_type,a.social_node,a.social_status  from \n(select d.id,case when d.chinesename is null then d.englishname else d.chinesename end social_person,a.logonname as social_id,c.optime,\'图书馆讨论室预约关系\' as social_type,cast(a.groupid as string) as social_node,\'正常\' as social_status\n\n from  bigdata_ld.usermember a  left join bigdata_ld.YYJL c on a.groupid=c.groupid\nleft join  bigdata_dw.dm_student_adaccount  d  on  rtrim(ltrim(upper(a.logonname))) = rtrim(ltrim(upper(d.ADACCOUNT)))\nwhere  d.id is not null ) a join (\nselect d.id,case when d.chinesename is null then d.englishname else d.chinesename end social_person,a.logonname as social_id,c.optime,\'图书馆讨论室预约关系\' as social_type,cast(a.groupid as string) as social_node,\'正常\' as social_status\n\n from  bigdata_ld.usermember a  left join bigdata_ld.YYJL c on a.groupid=c.groupid\nleft join  bigdata_dw.dm_student_adaccount  d  on  rtrim(ltrim(upper(a.logonname))) = rtrim(ltrim(upper(d.ADACCOUNT)))\nwhere  d.id is not null) b on a.social_node=b.social_node\nwhere a.id<>b.id', '1', 'HIVE', null, null, null, null, null, null, null, '0 45 3 ? * *', null, '2018-05-18 17:58:50', '2018-05-18 17:59:02', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('39', '1', 'dm_social_jy', null, 'insert overwrite table bigdata_dw.dm_social_jy  \n\nselect b.id,a.soail_name,a.soail_code,a.CreateDate,a.social_type,a.social_node,a.social_status  from (\n\nselect c.usercode,b.username as soail_name,b.id as soail_code ,a.CreateDate,\'就业关系\' as social_type, null as social_node,\n\'正常\' as social_status,c.username from bigdata_ld.MP_MentorStudent a join \n\n bigdata_ld.User_Account b on a.MentorAccountID=b.id\n\njoin  bigdata_ld.User_Account c  on a.StudentAccountID=c.id ) a left join bigdata_dw.dm_student_adaccount b on rtrim(ltrim(upper(a.usercode)))=rtrim(ltrim(upper(b.adaccount)))', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 5 ? * *', null, '2018-05-18 18:00:01', '2018-05-18 18:00:18', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('40', '1', 'dw_DA_AUTHORITY', null, 'insert overwrite  table bigdata_dw.DA_AUTHORITY   \nselect studentid,studentname,UPPER(daaccount) as daaccount,concat(\'XJTLU\\\\\\\',upper(daaccount)) as windows_adaccount ,student_focus from bigdata_ld.student\n', '1', 'HIVE', null, null, null, null, null, null, null, '0 45 3 ? * *', null, '2018-05-18 18:02:16', '2018-05-18 18:02:26', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('41', '1', 'da_student', null, 'insert overwrite table bigdata_dw.da_student \nselect a.studentid,b.daname,a.daaccount,case when substr(a.studentid,1,2) <50 then concat(\'20\',substr(a.studentid,1,2),\'-07-01\') else concat(\'2000\',\'-07-01\') end as time,\n\'DA关系\' as social_type,null as social_node,\'正常\' as social_status\n\n from bigdata_dw.DA_AUTHORITY a left join bigdata_ld.dalist b \non  rtrim(ltrim(upper(a.daaccount))) = rtrim(ltrim(upper(b.daaccount)))\n\nwhere b.daname is not null and a.daaccount is not null', '1', 'HIVE', null, null, null, null, null, null, null, '0 30 3 ? * *', null, '2018-05-18 18:03:30', '2018-05-18 18:03:46', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('43', '1', 'dw_M_STUDENT_SPR_ALL_zxxs', null, ' insert overwrite table bigdata_dw.M_STUDENT_SPR_ALL_zxxs \n  select id, chinesename  , spr_fnm1     , spr_fnm2     , spr_fnm3     , \n      spr_name     , englishname  , adaccount    , moa_code     , moa_snam     , \n      sts_code     , sts_name     , rou_code     , rou_code1    , level_cn     , \n      prg_code     , prg_name_cn  , prg_name_en  , sce_occl     , sce_blok     , \n      dpt_code     , dpt_name_cn  , dpt_name_en  , rou_name_cn  , rou_name_en  , \n      spr_sdate    , spr_edate    , spr_awdd     , spr_gend     , spr_dob      , \n      student_type , eth_code     , eth_name_cn  , eth_name_en  , case when from_region like \'%LOCAL%\' then \'内地\' when from_region like \'%NL1%\' then \'海外\'  when from_region like \'%NL2%\' then \'港澳台\' else from_region end as from_region, \n      stu_natc     , case when from_nat_name = \'Chinese\' then \'China\' else from_nat_name end from_nat_name, from_province, from_city    , stu_isar     , stu_ielr     , add_tel3     , add_teln     , snk_htel     , snk_hat3     , \n   add_emad     , prs_emad     , prs_name     , prs_addr     , prs_itel    from (\n  select * from bigdata_ld.M_STUDENT_SPR_ALL \n  where upper(sts_code)=\'C\'  and ( ROU_CODE1  like \'R%\' or ROU_CODE1 like \'P%\') and   FROM_REGION like \'LOCAL%\'  or upper(sts_code)=\'S\'\n   union all \nselect * from bigdata_ld.M_STUDENT_SPR_ALL where upper(sts_code)=\'C\'  and ROU_CODE1 like \'U%\' and SCE_OCCL like \'A%\'\n   union all\nselect * from bigdata_ld.M_STUDENT_SPR_ALL where upper(sts_code)=\'C\' and ( ROU_CODE1 not like \'R%\' and ROU_CODE1 not  like \'P%\' and ROU_CODE1 not  like \'U%\')\n  ) a \n  ', '1', 'HIVE', null, null, null, null, null, null, null, '0 45 3 ? * *', null, '2018-05-18 18:06:08', '2018-05-18 18:06:25', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('44', '1', 'dw_dm_student_adaccount', null, 'insert overwrite table bigdata_dw.dm_student_adaccount  \nselect ID,CHINESENAME,ENGLISHNAME,ADACCOUNT,MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n\n from (select a.*, row_number() OVER(PARTITION BY a.ADACCOUNT order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where   exists ( SELECT b.id,b.adaccount,count(1) as c\n  FROM bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,b.adaccount\n  having count(1)>1  ) ) h where  h.num=1 union all\nselect ID,CHINESENAME,ENGLISHNAME,nvl(ADACCOUNT,\'未使用\'),MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n from (\n select a.*, row_number() OVER(PARTITION BY a.ADACCOUNT order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where  not exists ( \n \n SELECT b.id,nvl(b.adaccount,\'未使用\') as ad ,count(1) as c\n  FROM  bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,nvl(b.adaccount,\'未使用\')\n  having count(1)>1    \n   ) \n  ) h where  h.num=1 ', '1', 'HIVE', null, null, null, null, null, null, null, '0 20 4 ? * *', null, '2018-05-18 18:07:30', '2018-05-18 18:07:42', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('45', '1', 'dm_social_student', null, 'insert overwrite table bigdata_dw.dm_social_student  \nselect a.id,a.social_person,a.social_id,to_date(a.time),a.social_type,a.social_node,a.social_status\n,case when b.chinesename is null then b.englishname else b.chinesename end as name from (\n--宿舍关系\nselect * from bigdata_eds.eds_social_student a\nwhere a.id<>a.social_id\nunion all\n--Buddy\nselect * from bigdata_eds.eds_buddy_student\nunion all\n--社团关系\nselect * from bigdata_eds.eds_club_student a\nwhere a.id<>a.social_id\nunion all\n--AA关系\nselect * from bigdata_eds.eds_aa_student\nunion all\n--图书馆讨论室预约关系\nselect * from bigdata_eds.eds_LIBRARY_jl_student a\nwhere a.id<>a.social_id\n--DA关系\nunion all\nselect studentid,daname,daaccount,time,social_type,social_node,social_status from bigdata_dw.da_student\n--就业关系\nunion all\n\nselect id,soail_name,cast(concat(\'JY\',soail_code) as string),CreateDate,social_type,social_node,social_status from bigdata_dw.dm_social_jy\n\n\n) a  join bigdata_dw.M_STUDENT_SPR_ALL_zxxs b on a.id=b.id', '1', 'HIVE', null, null, null, null, null, null, null, '0 45 5 ? * *', null, '2018-05-18 18:08:59', '2018-05-18 18:09:12', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('47', '1', 'dm_social_student_old', null, 'insert overwrite table bigdata_dw.dm_social_student_old \nselect  c.id,c.social_person,c.social_id,to_date(c.time),c.social_type,c.social_node,c.social_status\n,case when b.chinesename is null then b.englishname else b.chinesename end as name from (\n--宿舍关系\nselect * from bigdata_eds.eds_social_student a\nwhere a.id<>a.social_id\nunion all\n--Buddy\nselect * from bigdata_eds.eds_buddy_student\nunion all\n--社团关系\nselect * from bigdata_eds.eds_club_student a\nwhere a.id<>a.social_id\nunion all\n--AA关系\nselect * from bigdata_eds.eds_aa_student\nunion all\n--图书馆讨论室预约关系\nselect * from bigdata_eds.eds_LIBRARY_jl_student a\nwhere a.id<>a.social_id\n--DA关系\nunion all\nselect studentid,daname,daaccount,time,social_type,social_node,social_status from bigdata_dw.da_student\n--就业关系\nunion all\n\nselect id,soail_name,cast(concat(\'JY\',soail_code) as string),CreateDate,social_type,social_node,social_status from bigdata_dw.dm_social_jy\n\n\n) c  join bigdata_dw.M_STUDENT_SPR_ALL_zxxs b on c.id=b.id', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 17 ? * *', null, '2018-05-18 18:12:01', '2018-05-18 18:12:13', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('49', '1', 'eds_student_buddy', null, 'insert overwrite  table bigdata_eds.student_buddy  \nselect distinct a.* from (\n\nSELECT StudentID,substring(Buddy,instr(Buddy,\'\\n\'),8) as Buddy\n  FROM bigdata_ld.student\n  where Buddy is not null\n  union all\n  SELECT StudentID,substring(Buddy,9,8) \n  FROM bigdata_ld.student\n  where Buddy is not null\n  union all \n  SELECT StudentID,substring(Buddy,17,8) \n  FROM bigdata_ld.student\n  where Buddy is not null\n  union all\n   SELECT StudentID,substring(Buddy,25,8) \n  FROM bigdata_ld.student\n  where Buddy is not null\n  union all\n    SELECT StudentID,substring(Buddy,33,8) \n  FROM bigdata_ld.student\n  where Buddy is not null\n  union all\n  SELECT StudentID,substring(Buddy,41,8) \n  FROM bigdata_ld.student\n  where Buddy is not null\n  union all\n  SELECT StudentID,substring(Buddy,49,8) \n  FROM bigdata_ld.student\n  where Buddy is not null\n  )  a where length(a.Buddy)>5', '1', 'HIVE', null, null, null, null, null, null, null, '0 15 3 ? * *', null, '2018-05-18 19:00:01', '2018-05-18 19:03:27', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('50', '1', 'dw_dm_student_id_new', null, 'insert overwrite table bigdata_dw.dm_student_id_new \nselect ID,CHINESENAME,ENGLISHNAME,ADACCOUNT,MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n\n from (select a.*, row_number() OVER(PARTITION BY a.id order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where   exists ( SELECT b.id,b.adaccount,count(1) as c\n  FROM bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,b.adaccount\n  having count(1)>1  ) ) h where  h.num=1 union all\nselect ID,CHINESENAME,ENGLISHNAME,nvl(ADACCOUNT,\'未使用\'),MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n from (\n select a.*, row_number() OVER(PARTITION BY a.id order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where  not exists ( \n \n SELECT b.id,nvl(b.adaccount,\'未使用\') as ad ,count(1) as c\n  FROM  bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,nvl(b.adaccount,\'未使用\')\n  having count(1)>1    \n   ) \n  ) h where  h.num=1 ', '1', 'HIVE', null, null, null, null, null, null, null, '0 20 4 ? * *', null, '2018-05-18 19:07:42', '2018-05-18 19:17:57', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('52', '1', 'eds_aa_list', null, 'insert overwrite table bigdata_eds.aa_list \nselect bigdata_ld.row_sequence() as id,a.PRS_NAME,a.PRS_EMAD,a.PRS_ITEL,a.prs_addr from \n(\nselect distinct PRS_NAME,PRS_EMAD,PRS_ITEL,prs_addr                                         \nfrom bigdata_ld.m_student_spr_all\nwhere PRS_NAME is not null\n) a', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 4 ? * *', null, '2018-05-21 09:34:08', '2018-05-21 09:34:17', null, null, null, null, '0', null, null, null, null);
