INSERT INTO `tb_task` VALUES ('128', '1', 'eds_wifi', null, 'INSERT OVERWRITE  TABLE  BIGDATA_EDS.EDS_HW_CON_TSM_E PARTITION (year,month)\n\nselect a.username,a.timestamp_col,case when a.accountingstarttime is null then a.timestamp_col else  a.accountingstarttime end as accountingstarttime\n,a.accountingendtime,b.building,b.room,a.apmac,a.endpointgroup,substr(cast(a.timestamp_col as string),1,4) as     year,substr(cast(a.timestamp_col as string),6,2) as month\nfrom bigdata_ld.hw_con_tsm_e_r  a  left join  bigdata_ld.m_hw_apmac  b on \n\nconcat(substring(a.apmac,1,2),substring(a.apmac,4,2),substring(a.apmac,7,2),substring(a.apmac,10,2),substring(a.apmac,13,2),substring(a.apmac,16,2))\n=concat(substring(b.apmac,1,4),substring(b.apmac,6,4),substring(b.apmac,11,4))\n\nwhere to_date(a.timestamp_col)>to_date(DATE_SUB(from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\'),30))\nand a.accountingstarttime is not null and a.accountingendtime is not null', '1', 'HIVE', null, null, null, null, null, null, null, '0 40 3 ? * *', null, '2018-05-23 16:44:26', '2018-05-23 16:44:47', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('129', '1', 'eds_wifi_new', null, 'insert overwrite table BIGDATA_EDS.EDS_HW_CON_TSM_E_NEW\nselect  b.id,\n a.accountingstarttime,\n a.accountingendtime,\n concat(a.building,\' \',a.room) as location,\n \'WIFI连接日志\' as DATA_SOURCE,\n  b.ROU_CODE1, b.adaccount,b.LEVEL_CN,b.PRG_NAME_CN,b.DPT_NAME_CN,b.ROU_NAME_CN,\n b.SPR_GEND,b.SPR_DOB,b.ETH_NAME_CN,b.FROM_NAT_NAME,b.FROM_PROVINCE,b.FROM_CITY,b.STU_ISAR,b.STU_IELR,\n   from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as insert_date,\n   a.timestamps as timestamps\n from BIGDATA_EDS.EDS_HW_CON_TSM_E  a  left join   (  select ID,CHINESENAME,ENGLISHNAME,ADACCOUNT,MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n from (select a.*, row_number() OVER(PARTITION BY a.adaccount order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where   exists ( SELECT b.id,b.adaccount,count(1) as c\n  FROM bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,b.adaccount\n  having count(1)>1  ) ) h where  h.num=1 union all\nselect ID,CHINESENAME,ENGLISHNAME,nvl(ADACCOUNT,\'未使用\'),MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n from (\n select a.*, row_number() OVER(PARTITION BY a.adaccount order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where  not exists ( \n SELECT b.id,nvl(b.adaccount,\'未使用\') as ad ,count(1) as c\n  FROM  bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,nvl(b.adaccount,\'未使用\')\n  having count(1)>1    ) ) h where  h.num=1 ) b   on rtrim(ltrim(upper(a.username))) = rtrim(ltrim(upper(b.ADACCOUNT)))', '1', 'HIVE', null, null, null, null, null, null, null, '0 20 4 ? * *', null, '2018-05-23 16:54:15', '2018-05-23 16:54:28', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('132', '1', 'eds_V_CheckInOut', null, 'insert overwrite table bigdata_eds.eds_V_CheckInOut  \n\n\nselect c.readerid,c.CheckTime as checktime_start,null,case when c.checkresult =0 then \'FAIL CHECKIN\'\n when c.checkresult =1 then \'SECCEED CHECKIN\' end checkin_result,\'图书馆闸机刷卡记录\' as location_source\n from bigdata_ld.V_CheckInOut c  where CheckType like \'%CHECKIN%\' and  checktime>DATE_SUB(from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\'),30)\n \n union all\nselect d.readerid,null,d.CheckTime as checktime_end,case when d.checkresult =0 then \'FAIL CHECKOUT\'\nwhen d.checkresult =1 then \'SECCEED CHECKOUT\' end checkin_result,\'图书馆闸机刷卡记录\' as location_source\n from bigdata_ld.V_CheckInOut d where CheckType like \'%CHECKOUT%\' and checktime>DATE_SUB(from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\'),30)', '1', 'HIVE', null, null, null, null, null, null, null, '0 45 3 ? * *', null, '2018-05-23 17:00:32', '2018-05-23 17:00:47', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('133', '1', 'eds_BOOKBORROW_HISTORY', null, 'insert overwrite table bigdata_eds.BOOKBORROW_HISTORY  \n\nselect a.cert_id_f,a.lend_date  as start_time,null as end_time,a.location_name as location,\n\'图书借阅记录\' as data_source\n from  bigdata_ld.BOOKBORROW_HISTORY a\n union all\n select a.cert_id_f,null as start_time,a.ret_date as end_time,a.location_name as location,\n\'图书借阅记录\' as data_source\n from  bigdata_ld.BOOKBORROW_HISTORY a\n where a.ret_date is not null', '1', 'HIVE', null, null, null, null, null, null, null, '0 40 3 ? * *', null, '2018-05-23 17:01:43', '2018-05-23 17:02:05', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('137', '1', 'eds_ticket', null, 'insert overwrite TABLE  bigdata_eds.eds_otrs_Ticket_ALL\nselect customer_user_id,customer_id,\n\ncreate_time,\nchange_time,\ncase when queue_type like \'%MITS%\' then \'MITS\'  \nWHEN queue_type LIKE \'%Library%\' then \'Library\'\nWHEN queue_type like \'%SAO%\' then \'SAO\'\nWHEN queue_type like \'%CMO%\' then \'CMO\'\nELSE queue_type END queue_type,\nqueue_type,\nstatus,\nowner\nfrom bigdata_ld.OTRS_TICKET_ALL', '1', 'HIVE', null, null, null, null, null, null, null, '0 30 4 ? * *', null, '2018-05-23 17:15:35', '2018-05-23 17:15:50', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('138', '1', 'eds_LIBRARY_jl', null, 'insert overwrite table bigdata_eds.LIBRARY_jl \n\nselect a.logonname,    \na.truename,         \na.roomno,  \na.groupid, \na.optime,      \na.begintime,\na.endtime,\nb.logonname  as logonname_jl,\nb.truename as truename_jl,\nnull as memo,\n\'预约记录\' as jl\n\n\n\n\n from bigdata_ld.YYJL  a  left join  bigdata_ld.usermember  b  on  a.groupid=b.groupid\nunion all\n\nselect b.logonname,\nb.truename,       \nb.roomno,  \nnull,\nnull,\nb.cardtime, \nnull,\nnull,\nnull,\nb.memo,\n\'门禁刷卡记录\' as jl\n\n\n\nfrom bigdata_ld.DoorCardrec  b', '1', 'HIVE', null, null, null, null, null, null, null, '0 20 4 ? * *', null, '2018-05-23 17:17:56', '2018-05-23 17:18:16', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('139', '1', 'eds_sys_log', null, 'insert overwrite table  bigdata_eds.eds_sys_log     \n\n    select b.usercode,a.createdate as start_time,null as end_time,case when c.city=0 then c.country else c.city end as location,\'就业系统登录日志\' as data_source\n from bigdata_ld.sys_log a left join bigdata_ld.user_account  b on a.accountid=b.id   left join bigdata_ld.ip_ref_region  c on  a.ipaddress=c.ip', '1', 'HIVE', null, null, null, null, null, null, null, '0 45 3 ? * *', null, '2018-05-23 17:21:01', '2018-05-23 17:22:35', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('141', '1', 'eds_vocational_counselling', null, 'insert overwrite table bigdata_eds.vocational_counselling \nselect b.usercode,a.StartTime,a.EndTime,a.Location,\'就业咨询预约系统登录日志\' as data_source\n from bigdata_ld.Appointment  a  left join bigdata_ld.User_Account b   on  a.tutoruserid=b.id\n\nwhere a.ApplyUserID is not null  and a.status=\'Selected\'', '1', 'HIVE', null, null, null, null, null, null, null, '0 40 3 ? * *', null, '2018-05-23 17:25:18', '2018-05-23 17:25:35', null, null, null, null, '0', null, null, null, null);
