INSERT INTO `tb_task` VALUES ('144', '1', 'eds_pc_log', null, 'insert overwrite table bigdata_eds.eds_pc_log \n\nselect regexp_replace(reverse(substr(reverse(h.time),5,20)),\'-\',\'/\') ,h.event_code,h.task_category,h.source_workstation,h.\\`user\\`,h.src_nt_host,h.logon_account,\nh.logon_type,h.year,h.month,h.day  from \n(select  a.\\`time\\`,a.event_code,a.task_category,a.source_workstation,a.\\`user\\`,a.src_nt_host,a.logon_account,\na.logon_type,a.year,a.month,a.day\n\n\n from bigdata_ld.pc_log_table a\n\n \nunion all\n select \n a.time,a.event_code,a.task_category,a.source_workstation,a.\\`user\\`,a.src_nt_host,\n \n \n case\n when length(rtrim(ltrim(a.logon_account))) =14 then substr(rtrim(ltrim(a.logon_account)),1,1)\n when length(rtrim(ltrim(a.logon_account))) =15 then substr(rtrim(ltrim(a.logon_account)),1,2)\n when length(rtrim(ltrim(a.logon_account))) =16 then substr(rtrim(ltrim(a.logon_account)),1,3)\n when length(rtrim(ltrim(a.logon_account))) =17 then substr(rtrim(ltrim(a.logon_account)),1,4)\n when length(rtrim(ltrim(a.logon_account))) =18 then substr(rtrim(ltrim(a.logon_account)),1,5)\n when length(rtrim(ltrim(a.logon_account))) =19 then substr(rtrim(ltrim(a.logon_account)),1,6)\n when length(rtrim(ltrim(a.logon_account))) =20 then substr(rtrim(ltrim(a.logon_account)),1,7)\n when length(rtrim(ltrim(a.logon_account))) =21 then substr(rtrim(ltrim(a.logon_account)),1,8)\n when length(rtrim(ltrim(a.logon_account))) =22 then substr(rtrim(ltrim(a.logon_account)),1,9)\n when length(rtrim(ltrim(a.logon_account))) =23 then substr(rtrim(ltrim(a.logon_account)),1,10)\n when length(rtrim(ltrim(a.logon_account))) =24 then substr(rtrim(ltrim(a.logon_account)),1,11)\n when length(rtrim(ltrim(a.logon_account))) =25 then substr(rtrim(ltrim(a.logon_account)),1,12)\n when length(rtrim(ltrim(a.logon_account))) =26 then substr(rtrim(ltrim(a.logon_account)),1,13)\n when length(rtrim(ltrim(a.logon_account))) =27 then substr(rtrim(ltrim(a.logon_account)),1,14)\n when length(rtrim(ltrim(a.logon_account))) =28 then substr(rtrim(ltrim(a.logon_account)),1,15)\n when length(rtrim(ltrim(a.logon_account))) =29 then substr(rtrim(ltrim(a.logon_account)),1,16)\n when length(rtrim(ltrim(a.logon_account))) =30 then substr(rtrim(ltrim(a.logon_account)),1,17)\n when length(rtrim(ltrim(a.logon_account))) =31 then substr(rtrim(ltrim(a.logon_account)),1,18)\nend as logon_account,\na.logon_type,a.year,a.month,a.day\n\n from bigdata_ld.pc_log_table a \n where a.logon_account like \'%@xjtlu.edu.cn%\' )  h  join bigdata_eds.eds_students_adaccount b   on \n rtrim(ltrim(upper(h.logon_account))) = rtrim(ltrim(upper(b.ADACCOUNT))) ', '1', 'HIVE', null, null, null, null, null, null, null, '0 45 3 ? * *', null, '2018-05-23 17:32:06', '2018-05-23 17:32:29', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('145', '1', 'dw_pc_log_location', null, 'insert overwrite table bigdata_dw.pc_log_location \nselect upper(a.logon_account) as logon_account,a.\\`_c0\\` as start_time,null as end_time,a.source_workstation,\'PC LOG\' as data_source from bigdata_eds.eds_pc_log  a\nwhere a.source_workstation like \'%SC379%\'  or  a.source_workstation like \'%SD323%\'  or a.source_workstation like \'%SD319%\'\nor a.source_workstation like \'%SD546%\' or a.source_workstation like \'%SD554%\' or a.source_workstation like \'%EE305%\'\nor a.source_workstation like \'%EE311%\' or a.source_workstation like \'%EE309%\' or a.source_workstation like \'%EB369%\'\nor a.source_workstation like \'%EB447%\' or a.source_workstation like \'%EB441%\' or a.source_workstation like \'%P310%\'\nor a.source_workstation like \'%BA512%\' or a.source_workstation like \'%BA505%\' or a.source_workstation like \'%BA518%\'\nor a.source_workstation like \'%HS102%\' or a.source_workstation like \'%HS103%\' or a.source_workstation like \'%HS202%\'\nor a.source_workstation like \'%DB312%\' or a.source_workstation like \'%ES209%\' or a.source_workstation like \'%FB563%\'\nor a.source_workstation like \'%FB459%\' or a.source_workstation like \'%FB564%\' or a.source_workstation like \'%FB572%\'\nor a.source_workstation like \'%FB468%\' or a.source_workstation like \'%CB463%\' or a.source_workstation like \'%CB455%\'\nor a.source_workstation like \'%CB516%\' or a.source_workstation like \'%CB563%\' or a.source_workstation like \'%CB529%\'\nor a.source_workstation like \'%CB416%\' or a.source_workstation like \'%CB445%\' or a.source_workstation like \'%P318%\'\nor a.source_workstation like \'%DB105%\' or a.source_workstation like \'%SC375%\' or a.source_workstation like \'%CLASS%\'', '1', 'HIVE', null, null, null, null, null, null, null, '0 45 3 ? * *', null, '2018-05-23 17:34:46', '2018-05-23 17:35:02', null, null, null, null, '0', null, null, null, null);
