INSERT INTO `tb_task` VALUES ('158', '1', 'dw_student_id_old', null, 'insert overwrite table bigdata_dw.dm_student_id_old \nselect ID,CHINESENAME,ENGLISHNAME,ADACCOUNT,MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n\n from (select a.*, row_number() OVER(PARTITION BY a.id order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where   exists ( SELECT b.id,b.adaccount,count(1) as c\n  FROM bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,b.adaccount\n  having count(1)>1  ) ) h where  h.num=1 union all\nselect ID,CHINESENAME,ENGLISHNAME,nvl(ADACCOUNT,\'未使用\'),MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n from (\n select a.*, row_number() OVER(PARTITION BY a.id order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where  not exists ( \n \n SELECT b.id,nvl(b.adaccount,\'未使用\') as ad ,count(1) as c\n  FROM  bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,nvl(b.adaccount,\'未使用\')\n  having count(1)>1    \n   ) \n  ) h where  h.num=1 ', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 14 ? * *', null, '2018-05-23 18:03:21', '2018-05-23 18:03:37', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('163', '1', 'dw_dm_lxdh_bg_all', null, 'insert overwrite table bigdata_dw.dm_lxdh_bg_all  \nselect b.id,b.source_type,b.tel,to_date(b.time) as time from (\n--联系电话变更\nselect a.id,\'学生联系电话变更_移动\' as source_type,a.add_tel3_new as tel,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as time  from bigdata_dw.dm_lxdh_bg a\n\nunion all\n\nselect a.id,\'学生联系电话变更_固话\',a.add_teln_new as tel,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as time from bigdata_dw.dm_lxdh_bg a\n\nunion all\nselect a.id,\'紧急联系人电话变更_移动\',a.snk_htel_new as tel,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as time from bigdata_dw.dm_lxdh_bg a\n\nunion all\nselect a.id,\'紧急联系电话变更_固话\',a.snk_hat3_new as tel,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') from bigdata_dw.dm_lxdh_bg a\n\nunion all\n\n--就业联系电话变更\nselect b.id,\'就业联系电话变更_固话\',a.Telephone_old as tel,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as time from bigdata_dw.dm_lxdh_bg_jy a  join bigdata_dw.dm_student_adaccount b on rtrim(ltrim(upper(a.usercode)))=rtrim(ltrim(upper(b.adaccount)))\n\nunion all\nselect b.id,\'就业联系电话变更_手机\',a.MobilePhone_old as tel,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as time from bigdata_dw.dm_lxdh_bg_jy a join bigdata_dw.dm_student_adaccount b on rtrim(ltrim(upper(a.usercode)))=rtrim(ltrim(upper(b.adaccount)))\n\n\n\n\nunion all\n--望远镜联系电话变更\nselect a.studentid as id,\'望远镜联系电话变更_真实\',a.ContachnumberReal_new as tel,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as time from bigdata_dw.dm_lxdh_bg_wyj a\n\nunion all\n\nselect a.studentid as id,\'望远镜联系电话变更_补充信息\',a.supplementary_new as tel,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as time from bigdata_dw.dm_lxdh_bg_wyj a) b\nwhere b.tel is null', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 5 ? * *', null, '2018-05-23 18:16:13', '2018-05-23 18:16:29', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('164', '1', 'dw_dm_lxdh_bg_history', null, 'insert into table bigdata_dw.dm_lxdh_bg_history   \nselect b.id,b.source_type,b.tel,to_date(b.time) as time from (\n--联系电话变更\nselect a.id,\'学生联系电话变更_移动\' as source_type,a.add_tel3_new as tel,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as time  from bigdata_dw.dm_lxdh_bg a\n\nunion all\n\nselect a.id,\'学生联系电话变更_固话\',a.add_teln_new as tel,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as time from bigdata_dw.dm_lxdh_bg a\n\nunion all\nselect a.id,\'紧急联系人电话变更_移动\',a.snk_htel_new as tel,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as time from bigdata_dw.dm_lxdh_bg a\n\nunion all\nselect a.id,\'紧急联系电话变更_固话\',a.snk_hat3_new as tel,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') from bigdata_dw.dm_lxdh_bg a\n\nunion all\n\n--就业联系电话变更\nselect b.id,\'就业联系电话变更_固话\',a.Telephone_old as tel,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as time from bigdata_dw.dm_lxdh_bg_jy a  join bigdata_dw.dm_student_adaccount b on rtrim(ltrim(upper(a.usercode)))=rtrim(ltrim(upper(b.adaccount)))\n\nunion all\nselect b.id,\'就业联系电话变更_手机\',a.MobilePhone_old as tel,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as time from bigdata_dw.dm_lxdh_bg_jy a join bigdata_dw.dm_student_adaccount b on rtrim(ltrim(upper(a.usercode)))=rtrim(ltrim(upper(b.adaccount)))\n\n\n\n\nunion all\n--望远镜联系电话变更\nselect a.studentid as id,\'望远镜联系电话变更_真实\',a.ContachnumberReal_new as tel,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as time from bigdata_dw.dm_lxdh_bg_wyj a\n\nunion all\n\nselect a.studentid as id,\'望远镜联系电话变更_补充信息\',a.supplementary_new as tel,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as time from bigdata_dw.dm_lxdh_bg_wyj a) b\n', '1', 'HIVE', null, null, null, null, null, null, null, '0 30 5 ? * *', null, '2018-05-23 18:18:54', '2018-05-23 18:19:16', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('173', '1', 'dw_Academic_status', null, 'insert overwrite table  BIGDATA_DW.Academic_status\n\nselect d.*,b.ROU_CODE1,b.adaccount,b.level_cn,b.prg_name_cn,b.dpt_name_cn,b.rou_name_cn,b.spr_gend,b.spr_dob,b.eth_name_cn,b.from_nat_name,b.from_province,b.from_city,\nb.stu_ielr,b.stu_isar from \n\n(SELECT a.spr_code,a.ayr_code,a.mod_code,null as start_time,null as end_time,null as sab_note,\'挂科\' as Academic_status  FROM bigdata_eds.eds_SITS_SMR_FAILURE a\nunion all\nselect  b.sce_sjcj,b.sce_ayrc,null as mod_code,b.sce_begd,b.sce_endd,null as sab_note,\'留级\' as  Academic_status   from  bigdata_eds.eds_SITS_SCE_XRETAKE b\nunion all\nselect c.sab_stuc,c.sab_ayrc,null as mod_code,c.sab_begd,c.sab_endd,c.sab_note,\'休学\' as Academic_status   from bigdata_eds.eds_t_srs_sab c ) d \n\nleft join  ( \nselect ID,CHINESENAME,ENGLISHNAME,ADACCOUNT,MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n\n from (select a.*, row_number() OVER(PARTITION BY a.id order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where   exists ( SELECT b.id,b.adaccount,count(1) as c\n  FROM bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,b.adaccount\n  having count(1)>1  ) ) h where  h.num=1 union all\nselect ID,CHINESENAME,ENGLISHNAME,nvl(ADACCOUNT,\'未使用\'),MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n from (\n select a.*, row_number() OVER(PARTITION BY a.id order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where  not exists ( \n \n SELECT b.id,nvl(b.adaccount,\'未使用\') as ad ,count(1) as c\n  FROM  bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,nvl(b.adaccount,\'未使用\')\n  having count(1)>1    \n   ) \n  ) h where  h.num=1 \n)  b on  d.spr_code=b.id', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 5 ? * *', null, '2018-05-23 19:40:18', '2018-05-23 19:40:32', null, null, null, null, '0', null, null, null, null);
