INSERT INTO `tb_task` VALUES ('175', '1', 'dw_attendance_information', null, 'insert overwrite  table bigdata_dw.attendance_information \nSELECT h.idnumber ,to_date(cast(FROM_UNIXTIME(h.timecreated,\'yyyy-MM-dd HH:mm:ss\') as string)),\nconcat(\n\n\ncase when hour(cast(FROM_UNIXTIME(h.timecreated,\'yyyy-MM-dd HH:mm:ss\') as string))<10 then concat(\'0\',hour(cast(FROM_UNIXTIME(h.timecreated,\'yyyy-MM-dd HH:mm:ss\') as string)))\nelse hour(cast(FROM_UNIXTIME(h.timecreated,\'yyyy-MM-dd HH:mm:ss\') as string)) end,\':\',case when minute(cast(FROM_UNIXTIME(h.timecreated,\'yyyy-MM-dd HH:mm:ss\') as string))<10 then \nconcat(\'0\',minute(cast(FROM_UNIXTIME(h.timecreated,\'yyyy-MM-dd HH:mm:ss\') as string))) else minute(cast(FROM_UNIXTIME(h.timecreated,\'yyyy-MM-dd HH:mm:ss\') as string)) end \n\n)\n as time,\nb.description,t.fullname,\'ICE签到信息\' AS date_source  \nFROM bigdata_ld.mdl_attendance_log a \nLEFT JOIN bigdata_ld.mdl_attendance_statuses b ON a.statusid\n=b.id \nLEFT JOIN bigdata_ld.mdl_user h ON h.id=a.studentid\n\nLEFT JOIN \n(SELECT d.*,f.course FROM bigdata_ld.mdl_attendance_sessions  d LEFT JOIN bigdata_ld.mdl_attendance f ON d.attendanceid=f.id) c ON c.id=a.sessionid \n  LEFT JOIN bigdata_ld.mdl_course t ON  c.course=t.id', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 5 ? * *', null, '2018-05-23 20:01:24', '2018-05-23 20:02:06', null, null, null, null, '0', null, null, null, null);
