INSERT INTO `tb_task` VALUES ('189', '1', 'otrs_Ticket_ALL', null, 'insert overwrite table  bigdata_ld.otrs_Ticket_ALL\nSELECT \n  ticket.tn,  \n  ticket.title,  \n  ticket.customer_id,  \n  ticket.customer_user_id,\n  ticket.create_time,\n  ticket.change_time,\n  queue.\\`name\\` AS queue_type, \n  ticket_state.\\`name\\` AS status,   \n  users.login AS owner\nFROM \n  bigdata_ld.ticket,\n  bigdata_ld.queue,\n  bigdata_ld.ticket_state,\n  bigdata_ld.users\nWHERE\n  ticket.queue_id = queue.id\n  AND ticket.ticket_state_id = ticket_state.id\n  AND ticket.change_by = users.id', '1', 'HIVE', null, null, null, null, null, null, null, '0 45 3 ? * *', null, '2018-05-24 09:59:29', '2018-05-24 09:59:39', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('190', '1', 'dw_dm_lxdh_bg_wyj', null, 'insert overwrite table bigdata_dw.dm_lxdh_bg_wyj \n\nselect bigdata_ld.row_sequence() as row_number,a.studentid,\'望远镜联系电话变更\',a.ContachnumberReal as ContachnumberReal_new,b.ContachnumberReal as \nContachnumberReal_old,a.supplementary as supplementary_new,b.supplementary as supplementary_old\nfrom bigdata_ld.student a join bigdata_eds.eds_student b  on a.studentid=b.studentid and a.studentname=b.studentname\nwhere a.ContachnumberReal<>b.ContachnumberReal  or a.supplementary<>b.supplementary', '1', 'HIVE', null, null, null, null, null, null, null, '0 20 4 ? * *', null, '2018-05-24 10:05:13', '2018-05-24 10:05:24', null, null, null, null, '0', null, null, null, null);
