INSERT INTO `tb_task` VALUES ('225', '1', 'eds_test_login', null, 'insert overwrite table bigdata_eds.eds_test_login   \n\nselect a.Username,a.\\`date/time\\` as start_time,null as end_time,case when a.Event like \'%Login.Success%\'  then  \'SECCEED login\'\nend checkin_result,\'电子文献系统登录日志\' as location_source,case when b.city=0 then b.country when b.city is null then b.country else b.city end as location\n\nfrom bigdata_ld.flume_login a  left join bigdata_ld.ip_ref_region  b  on  a.ip=b.ip\nwhere a.\\`date/time\\` not like \'Date%\'  and a.Event not like \'%System%\' and a.username is not null\n\nunion all\n\nselect a.Username,null as start_time,a.\\`date/time\\` as end_time,case when a.Event like \'%Logout%\'  then  \'SECCEED logout\'\nend checkin_result,\'电子文献系统登录日志\' as location_source,case when b.city=0 then b.country when b.city is null then b.country else b.city end as location\n\nfrom bigdata_ld.flume_login  a left join bigdata_ld.ip_ref_region  b  on  a.ip=b.ip\nwhere a.\\`date/time\\` not like \'Date%\'  and a.Event not like \'%System%\' and a.username is not null', '1', 'HIVE', null, null, null, null, null, null, null, '0 30 4 ? * *', null, '2018-05-25 09:47:22', '2018-05-25 09:47:32', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('226', '1', 'eds_logstore_standard_log', null, 'insert overwrite table bigdata_eds.eds_logstore_standard_log \nSELECT b.idnumber,a.timecreated AS start_time,NULL AS end_time,\nCASE WHEN c.city=0 THEN c.country WHEN c.city IS NULL THEN c.country ELSE c.city END AS location,\'ICE用户操作日志\' as data_source\n FROM bigdata_ld.mdl_logstore_standard_log  a LEFT JOIN bigdata_ld.mdl_user b ON a.userid=b.id  \n LEFT JOIN  bigdata_ld.ip_ref_region  c  ON a.ip=c.ip\nWHERE a.target = \'user\' AND a.ACTION=\'loggedin\'\n\nunion all\n\nSELECT b.idnumber,null AS start_time,a.timecreated  AS end_time,\nCASE WHEN c.city=0 THEN c.country WHEN c.city IS NULL THEN c.country ELSE c.city END AS location,\'ICE用户操作日志\' as data_source\n FROM bigdata_ld.mdl_logstore_standard_log  a LEFT JOIN bigdata_ld.mdl_user b ON a.userid=b.id  \n LEFT JOIN  bigdata_ld.ip_ref_region  c  ON a.ip=c.ip\nWHERE a.target = \'user\' AND a.action=\'loggedout\'   OR a.target= \'user_login\'', '1', 'HIVE', null, null, null, null, null, null, null, '0 40 3 ? * *', null, '2018-05-25 10:12:45', '2018-05-25 10:13:08', null, null, null, null, '0', null, null, null, null);
