INSERT INTO `tb_task` VALUES ('238', '1', 'dw_dpt_authority', null, 'insert overwrite table  bigdata_dw.dpt_authority \n\nselect resault as dpt_code,daaccount,concat(\'XJTLU\\\\\\\',c.daaccount)  as windows_adaccount from (select a.daaccount,a.department,b.windows_adaccount from bigdata_ld.dalist  a  left join (select distinct daaccount,windows_adaccount from  bigdata_dw.da_authority) b\non a.daaccount=b.daaccount  and a.department is not null) c\n\nlateral view explode(split(c.department, \'\\r\')) adtable as resault ', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 7 ? * *', null, '2018-05-25 14:25:16', '2018-05-25 14:26:49', null, null, null, null, '0', null, null, null, null);
