INSERT INTO `tb_task` VALUES ('241', '1', 'dw_task_list', null, 'insert overwrite  table  bigdata_dw.task_list  \n\nselect  concat(bigdata_ld.row_sequence(),a.student_id,to_date(from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\'))),b.adaccount as student_ad,a.risk_type,\ncase when a.risk_type like \'%risk_psychology%\' then \'高\'   \nwhen a.risk_type like \'%risk_onestop%\' then \'高\'\nwhen a.risk_type like \'%risk_dormitory%\' then \'高\'\nwhen a.risk_type like \'%risk_suspend%\' then \'低\'\nwhen a.risk_type like \'%risk_studentstatuschange%\' then \'低\'\nwhen a.risk_type like \'%sk_exchangedormitory%\' then \'低\'\nwhen a.risk_type like \'%risk_contactchange%\' then \'低\'\nwhen a.risk_type like \'%Abnormal records of teaching material distribution%\' then \'低\'\nwhen a.risk_type like \'%risk_missingtest%\' then \'低\'\nwhen a.risk_type like \'%risk_failed%\' then \'低\'\nwhen a.risk_type like \'%Telescope contact telephone change%\' then \'低\'\nend as risk_rank,1 as risk_probability,to_date(a.risk_time) as risk_time,c.daaccount as DA_ad,\n\ncase when a.risk_type like \'%risk_psychology%\' then \'07紧急事件\'\nwhen a.risk_type like \'%risk_dormitory%\' then \'07紧急事件\'\nwhen a.risk_type like \'%risk_onestop%\' then \'07紧急事件\'\nwhen a.risk_type like \'%risk_suspend%\' then \'02提醒通知\'\nwhen a.risk_type like \'%risk_studentstatuschange%\' then \'02提醒通知\'\nwhen a.risk_type like \'%risk_failed%\' then \'03个人访谈\'\nwhen a.risk_type like \'%risk_missingtest%\' then \'03个人访谈\'\nwhen a.risk_type like \'%risk_suspend%\' then \'03个人访谈\'\nwhen a.risk_type like \'%sk_exchangedormitory%\' then \'03个人访谈\'\nwhen a.risk_type like \'%risk_inactive%\' then \'03个人访谈\' else null end as task_type,\nto_date(date_add(cast(a.risk_time as string),7)) as rask_endtime,a.risk_description as risk_detail,\ncast(null as string) as task_status,cast(null as string) as task_code,cast(null as string) as do_datetime,cast(null as string) as do_user,cast(null as string) as do_result,\ncast(null as string) as spare_field\n\n\n from bigdata_dw.student_risk_history a \nleft join bigdata_dw.dm_student_id_new b on a.student_id=b.id\nleft join bigdata_dw.DA_AUTHORITY c on a.student_id=c.studentid', '1', 'HIVE', null, null, null, null, null, null, null, '0 15 7 ? * *', null, '2018-05-25 16:07:59', '2018-05-29 18:07:38', null, null, null, null, '0', null, null, null, null);
