INSERT INTO `tb_task` VALUES ('269', '1', 'dw_DM_LIBRARY_JL', null, 'insert overwrite table  BIGDATA_DW.DM_LIBRARY_JL  \nselect a.*,b.ROU_CODE1,b.level_cn,b.prg_name_cn,b.dpt_name_cn,b.rou_name_cn,b.spr_gend,b.spr_dob,b.eth_name_cn,b.from_nat_name,b.from_province,b.from_city,\nb.stu_ielr,b.stu_isar\n\n\n\n\nfrom bigdata_eds.LIBRARY_jl  a   left join  ( \nselect ID,CHINESENAME,ENGLISHNAME,ADACCOUNT,MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n\n from (select a.*, row_number() OVER(PARTITION BY a.ADACCOUNT order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where   exists ( SELECT b.id,b.adaccount,count(1) as c\n  FROM bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,b.adaccount\n  having count(1)>1  ) ) h where  h.num=1 union all\nselect ID,CHINESENAME,ENGLISHNAME,nvl(ADACCOUNT,\'未使用\'),MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n from (\n select a.*, row_number() OVER(PARTITION BY a.ADACCOUNT order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where  not exists ( \n \n SELECT b.id,nvl(b.adaccount,\'未使用\') as ad ,count(1) as c\n  FROM  bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,nvl(b.adaccount,\'未使用\')\n  having count(1)>1    \n   ) \n  ) h where  h.num=1 \n)  b   on  rtrim(ltrim(upper(a.logonname))) = rtrim(ltrim(upper(b.ADACCOUNT)))', '1', 'HIVE', null, null, null, null, null, null, null, '0 40 4 ? * *', null, '2018-05-30 15:22:31', '2018-05-30 15:22:57', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('270', '1', 'eds_students_adaccount', null, ' insert overwrite table bigdata_eds.eds_students_adaccount  \n\nselect ID,CHINESENAME,ENGLISHNAME,ADACCOUNT,MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n from (select a.*, row_number() OVER(PARTITION BY a.adaccount order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where   exists ( SELECT b.id,b.adaccount,count(1) as c\n  FROM bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,b.adaccount\n  having count(1)>1  ) ) h where  h.num=1 union all\nselect ID,CHINESENAME,ENGLISHNAME,nvl(ADACCOUNT,\'未使用\'),MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n from (\n select a.*, row_number() OVER(PARTITION BY a.adaccount order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where  not exists ( \n SELECT b.id,nvl(b.adaccount,\'未使用\') as ad ,count(1) as c\n  FROM  bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,nvl(b.adaccount,\'未使用\')\n  having count(1)>1    ) ) h where  h.num=1', '1', 'HIVE', null, null, null, null, null, null, null, '0 15 3 ? * *', null, '2018-05-30 16:14:14', '2018-05-30 16:14:23', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('271', '1', 'eds_aa_student', null, 'insert overwrite table bigdata_eds.eds_aa_student\nselect distinct a.id,a.prs_name,cast(b.id as string) as social_id,case when substr(a.id,1,2) <50 then concat(\'20\',substr(a.id,1,2),\'-07-01\') else concat(\'2000\',\'-07-01\') end as time,\n\'AA关系\' as social_type,cast(null as string) as social_node,\'正常\' as social_status\n\nfrom bigdata_ld.m_student_spr_all a  right join bigdata_eds.aa_list b\n\n\n\non a.PRS_NAME=b.PRS_NAME\nwhere a.prs_name is not null', '1', 'HIVE', null, null, null, null, null, null, null, '0 45 4 ? * *', null, '2018-05-30 18:17:20', '2018-05-30 18:17:28', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('272', '1', 'dw_student_risk_history', null, 'insert overwrite table bigdata_dw.student_risk_history   \nselect concat(bigdata_ld.row_sequence(),h.student_id ) as sequence,h.student_id,h.risk_type,to_date(from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\')) as risk_time,h.risk_degree, h.risk_description\n from (select c.student_id,c.risk_type,c.risk_degree,c.risk_description,count(1) as a from (\nselect distinct e.student_id,e.risk_type,e.risk_degree,e.risk_description from \n(select a.student_id,a.risk_type,a.risk_degree,a.risk_description from bigdata_dw.student_risk a  \nunion all\nselect b.student_id,b.risk_type,b.risk_degree,b.risk_description from bigdata_dw.student_risk_old b ) e\n) c\ngroup by c.student_id,c.risk_type,c.risk_degree,c.risk_description\nhaving count(1)=1) h ', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 7 ? * *', null, '2018-05-30 20:06:07', '2018-05-30 20:06:16', null, null, null, null, '0', null, null, null, null);
