INSERT INTO `tb_task` VALUES ('276', '1', 'dw_dm_location_ADACCOUNT', null, 'insert overwrite  table bigdata_dw.dm_location_ADACCOUNT   \nselect b.id,g.begintime,g.endtime,g.location,g.data_source,\nb.ROU_CODE1, b.adaccount,b.LEVEL_CN,b.PRG_NAME_CN,b.DPT_NAME_CN,b.ROU_NAME_CN,\n b.SPR_GEND,b.SPR_DOB,b.ETH_NAME_CN,b.FROM_NAT_NAME,b.FROM_PROVINCE,b.FROM_CITY,b.STU_ISAR,b.STU_IELR,\n   from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as insert_date,case when to_date(regexp_replace(g.begintime,\'/\',\'-\')) is null then to_date(regexp_replace(g.endtime,\'/\',\'-\')) else to_date(regexp_replace(g.begintime,\'/\',\'-\')) end as date_time\n   \n   --图书馆讨论室预约\n from (select a.logonname,a.begintime,a.endtime,concat(\'图书馆讨论室:\',a.roomno) as location,\'图书馆讨论室预约记录\' as data_source from bigdata_eds.LIBRARY_jl a  \n union all \n --就业系统\nselect * from bigdata_eds.eds_sys_log\n--图书馆文献系统登录日志\nunion all\nselect a.username,a.start_time,a.end_time,a.location,a.location_source\n from bigdata_eds.eds_test_login a\n where a.end_time <>\'Date/Time\'\n \n--就业咨询预约系统\n\nunion all\n\nselect * from bigdata_eds.vocational_counselling\n\n--email登录日志\nunion all\n\nselect * from bigdata_eds.eds_email_log\nwhere to_date(start_time)<=to_date(from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\'))\n\nunion all\n--pc_log登录日志\nselect * from bigdata_dw.pc_log_location\n\n\n\n)  g \n\n left join  ( \nselect ID,CHINESENAME,ENGLISHNAME,ADACCOUNT,MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n\n from (select a.*, row_number() OVER(PARTITION BY a.ADACCOUNT order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where   exists ( SELECT b.id,b.adaccount,count(1) as c\n  FROM bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,b.adaccount\n  having count(1)>1  ) ) h where  h.num=1 union all\nselect ID,CHINESENAME,ENGLISHNAME,nvl(ADACCOUNT,\'未使用\'),MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n from (\n select a.*, row_number() OVER(PARTITION BY a.ADACCOUNT order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where  not exists ( \n \n SELECT b.id,nvl(b.adaccount,\'未使用\') as ad ,count(1) as c\n  FROM  bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,nvl(b.adaccount,\'未使用\')\n  having count(1)>1    \n   ) \n  ) h where  h.num=1 \n)  b   on  rtrim(ltrim(upper(g.logonname))) = rtrim(ltrim(upper(b.ADACCOUNT)))', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 5 ? * *', null, '2018-06-01 14:43:46', '2018-06-01 14:44:01', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('280', '1', 'dw_DM_LOCATION', null, 'insert overwrite table bigdata_dw.DM_LOCATION \nselect p.mal_mstc, p.start_time, p.end_time, p.location,p.DATA_SOURCE, b.ROU_CODE1, b.adaccount,b.LEVEL_CN,b.PRG_NAME_CN,b.DPT_NAME_CN,b.ROU_NAME_CN,\n b.SPR_GEND,b.SPR_DOB,b.ETH_NAME_CN,b.FROM_NAT_NAME,b.FROM_PROVINCE,b.FROM_CITY,b.STU_ISAR,b.STU_IELR,\n   from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as insert_date,\n   case when p.start_time is null then to_date(p.end_time) else to_date(p.start_time) end as date_time\n   \nfrom (\n--eBridge登录\nselect a.mal_mstc,\n concat(to_date(a.mal_begd),\' \',case when hour(a.mal_begt)<10 then concat(\'0\',hour(a.mal_begt)) else hour(a.mal_begt) end ,\':\',case when minute(a.mal_begt)<10 then concat(\'0\',minute(a.mal_begt)) else minute(a.mal_begt) end ,\':\',case when second(a.mal_begt)<10 then concat(\'0\',second(a.mal_begt)) else second(a.mal_begt) end) as start_time,\nconcat(to_date(a.mal_endd),\' \',case when hour(a.mal_endt)<10 then concat(\'0\',hour(a.mal_endt)) else hour(a.mal_endt) end ,\':\',case when minute(a.mal_endt)<10 then concat(\'0\',minute(a.mal_endt)) else minute(a.mal_endt) end ,\':\',case when second(a.mal_endt)<10 then concat(\'0\',second(a.mal_endt)) else second(a.mal_endt) end) as end_time,\n\'登录过eBridge\'  location,\n   \'eBridge登录日志\' DATA_SOURCE\n from bigdata_eds.eds_sits_men_mal a  \nunion all\n--打印机登录\nselect nvl(UserFullName,\'未定义\') as UserFullName,StartDateTime,EndDateTime,case when devicelocation is null then \'登录过打印机系统\' else devicelocation end as location,\'打印机登录日志\' DATA_SOURCE from bigdata_eds.eds_print_scTracking  b\n--进出闸机\nunion all\nselect a.* from bigdata_eds.eds_V_CheckInOut  a -- join bigdata_dw.M_STUDENT_SPR_ALL_zxxs  b  on a.readerid=b.id\nunion all\n--图书借阅记录\n\nselect * from bigdata_eds.BOOKBORROW_HISTORY\nunion all\n--ICE用户操作日志\n\nselect * from bigdata_eds.eds_logstore_standard_log\n\nunion all\n--ICE签到日志\nselect * from bigdata_eds.eds_attendance_log\nwhere substr(location,1,7)  like \'%Present%\' \nunion all\n--社团签到\nselect cast(id as string),starttime,endtime,location,data_source from bigdata_eds.eds_club\n\n\n\n) p\nleft join  ( \nselect ID,CHINESENAME,ENGLISHNAME,ADACCOUNT,MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n\n from (select a.*, row_number() OVER(PARTITION BY a.id order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where   exists ( SELECT b.id,b.adaccount,count(1) as c\n  FROM bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,b.adaccount\n  having count(1)>1  ) ) h where  h.num=1 union all\nselect ID,CHINESENAME,ENGLISHNAME,nvl(ADACCOUNT,\'未使用\'),MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n from (\n select a.*, row_number() OVER(PARTITION BY a.id order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where  not exists ( \n \n SELECT b.id,nvl(b.adaccount,\'未使用\') as ad ,count(1) as c\n  FROM  bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,nvl(b.adaccount,\'未使用\')\n  having count(1)>1    \n   ) \n  ) h where  h.num=1 \n)  b on  p.mal_mstc=b.id\nunion all\nselect a.*,to_date(create_time) as time from bigdata_eds.eds_OTRS_TICKET_ALL_new a\n--登录WIFI\nunion all  \nselect c.id,c.accountingstarttime,c.accountingendtime,c.location,c.data_source,c.rou_code1,\nc.adaccount,c.level_cn,c.prg_name_cn,c.dpt_name_cn,c.rou_name_cn,c.spr_gend,c.spr_dob,c.eth_name_cn,\nc.from_nat_name,c.from_province,c.from_city,c.stu_isar,c.stu_ielr,c.insert_date,to_date(c.timestamps) as date_time  from BIGDATA_EDS.EDS_HW_CON_TSM_E_NEW c\n\nunion all\n--图书馆教室预约\n--就业系统\nselect * from bigdata_dw.dm_location_ADACCOUNT', '1', 'HIVE', null, null, null, null, null, null, null, '0 20 5 ? * *', null, '2018-06-04 17:36:59', '2018-06-04 17:37:16', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('286', '1', 'dw_task_list_automatic', null, 'insert overwrite table bigdata_dw.task_list_automatic  \n--留级\nselect distinct a.* from bigdata_dw.task_list a \n join bigdata_dw.m_student_spr_all_zxxs c on upper(rtrim(ltrim(a.student_ad)))=upper(rtrim(ltrim(c.adaccount)))\n join bigdata_ld.student b on c.id=b.studentid\n\nwhere a.risk_type like \'%risk_rebuilt%\' and (b.risk_rebuilt is null and c.rou_code1=\'U\' and c.from_region=\'内地\' or cast(a.risk_time as timestamp)>cast(b.risk_rebuilt as timestamp))\n \nunion all\n--休学\nselect  distinct a.* from bigdata_dw.task_list a \n join bigdata_dw.m_student_spr_all_zxxs c on upper(rtrim(ltrim(a.student_ad)))=upper(rtrim(ltrim(c.adaccount)))\n join bigdata_ld.student b on c.id=b.studentid\nwhere  a.risk_type like \'%risk_suspend%\' and (b.risk_suspend is null and c.rou_code1=\'U\' and c.from_region=\'内地\' or cast(a.risk_time as timestamp)>cast(b.risk_suspend as timestamp))\n\nunion all\n--挂科\nselect distinct a.* from bigdata_dw.task_list a \n join bigdata_dw.m_student_spr_all_zxxs c on upper(rtrim(ltrim(a.student_ad)))=upper(rtrim(ltrim(c.adaccount)))\n join bigdata_ld.student b on c.id=b.studentid\nwhere  a.risk_type like \'%risk_failed%\' and (b.risk_failed is null and c.rou_code1=\'U\' and c.from_region=\'内地\' or cast(a.risk_time as timestamp)>cast(b.risk_failed as timestamp))\n\nunion all\n--活跃度\nselect distinct a.* from bigdata_dw.task_list a \n join bigdata_dw.m_student_spr_all_zxxs c on upper(rtrim(ltrim(a.student_ad)))=upper(rtrim(ltrim(c.adaccount)))\n join bigdata_ld.student b on c.id=b.studentid\nwhere  a.risk_type like \'%risk_inactive%\' and (b.risk_inactive is null and c.sts_code=\'C\'  and c.rou_code1=\'U\' and c.from_region=\'内地\' or cast(a.risk_time as timestamp)>cast(b.risk_inactive as timestamp))\n--剔除14天已派发的任务\nand a.student_ad not in (select distinct student_ad from bigdata_dw.task_list_ht  where to_date(risk_time)>=date_sub(to_date(from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\')),14)\nand risk_type like \'%risk_inactive%\')\n\nunion all\n\n--调换宿舍\nselect distinct h.risk_code,h.student_ad,h.risk_type,h.risk_rank,h.risk_probability,h.risk_time,h.da_ad,h.task_type,h.rask_endtime,h.risk_detail,\nh.task_status,h.task_code,h.do_datetime,h.do_user,h.do_result,h.spare_field\nfrom (\nselect a.risk_code,a.student_ad,a.risk_type,a.risk_rank,a.risk_probability,a.risk_time,a.da_ad,a.task_type,a.rask_endtime,a.risk_detail,\na.task_status,a.task_code,a.do_datetime,a.do_user,a.do_result,a.spare_field  from bigdata_dw.task_list a \n join bigdata_dw.m_student_spr_all_zxxs c on upper(rtrim(ltrim(a.student_ad)))=upper(rtrim(ltrim(c.adaccount)))\n join bigdata_ld.student b on c.id=b.studentid\nwhere  a.risk_type like \'%risk_exchangedormitory%\' and (b.risk_exchangedormitory is null and c.sts_code=\'C\' and c.from_region=\'内地\' or cast(a.risk_time as timestamp)> cast(b.risk_exchangedormitory as timestamp))\n\nunion all\nselect distinct a.* from  bigdata_dw.task_list a \n join bigdata_dw.m_student_spr_all_zxxs c on upper(rtrim(ltrim(a.student_ad)))=upper(rtrim(ltrim(c.adaccount)))\n join bigdata_ld.student b on c.id=b.studentid\n where c.id in ( select d.id from (\nselect c.id,a.risk_type,count(1) as aaa from  bigdata_dw.task_list a \n join bigdata_dw.m_student_spr_all_zxxs c on upper(rtrim(ltrim(a.student_ad)))=upper(rtrim(ltrim(c.adaccount)))\n join bigdata_ld.student b on c.id=b.studentid\n \ngroup by c.id,a.risk_type\nhaving count(1)>=3  and a.risk_type like \'%risk_exchangedormitory%\'   ) d )  and a.risk_type like \'%risk_exchangedormitory%\' \nand c.sts_code=\'C\' and c.from_region=\'内地\'\n) h\n--缺考\nunion all\nselect distinct a.* from bigdata_dw.task_list a \n join bigdata_dw.m_student_spr_all_zxxs c on upper(rtrim(ltrim(a.student_ad)))=upper(rtrim(ltrim(c.adaccount)))\n join bigdata_ld.student b on c.id=b.studentid\nwhere  a.risk_type like \'%risk_missingtest%\' and (b.risk_missingtest is null or cast(a.risk_time as timestamp)>  cast(b.risk_missingtest as timestamp))\nunion all\n--心理风险\n\nselect distinct a.* from bigdata_dw.task_list a \n join bigdata_dw.m_student_spr_all_zxxs c on upper(rtrim(ltrim(a.student_ad)))=upper(rtrim(ltrim(c.adaccount)))\n join bigdata_ld.student b on c.id=b.studentid\n\nwhere a.risk_type like \'%risk_psychology%\' and (b.risk_psychology is null  and c.from_region=\'内地\' or cast(a.risk_time as timestamp)> cast(b.risk_psychology as timestamp))\n\nunion all\n--宿舍异常\nselect distinct a.* from bigdata_dw.task_list a \n join bigdata_dw.m_student_spr_all_zxxs c on upper(rtrim(ltrim(a.student_ad)))=upper(rtrim(ltrim(c.adaccount)))\n join bigdata_ld.student b on c.id=b.studentid\n\nwhere a.risk_type like \'%risk_dormitory%\' and (b.risk_dormitory is null and c.from_region=\'内地\'  or cast(a.risk_time as timestamp)> cast(b.risk_dormitory as timestamp))\n\nunion all\n--一站式上报\nselect distinct a.* from bigdata_dw.task_list a \n join bigdata_dw.m_student_spr_all_zxxs c on upper(rtrim(ltrim(a.student_ad)))=upper(rtrim(ltrim(c.adaccount)))\n join bigdata_ld.student b on c.id=b.studentid\n\nwhere a.risk_type like \'%risk_onestop%\' and (b.risk_onestop is null and c.from_region=\'内地\'  or cast(a.risk_time as timestamp)> cast(b.risk_onestop as timestamp))\nunion all\n--学籍状态变更\nselect distinct a.* from bigdata_dw.task_list a \n join bigdata_dw.m_student_spr_all_zxxs c on upper(rtrim(ltrim(a.student_ad)))=upper(rtrim(ltrim(c.adaccount)))\n join bigdata_ld.student b on c.id=b.studentid\n\nwhere a.risk_type like \'%risk_studentstatuschange%\' and (b.risk_studentstatuschange is null and c.rou_code1=\'U\' and c.from_region=\'内地\' or cast(a.risk_time as timestamp)> cast(b.risk_studentstatuschange as timestamp))', '1', 'HIVE', null, null, null, null, null, null, null, '0 35 7 ? * *', null, '2018-06-07 09:14:17', '2018-06-07 09:14:28', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('287', '1', 'wifi_realtime_new', null, 'insert overwrite table bigdata_dw.wifi_realtime_new  \n\nselect  b.id,\n a.accountingstarttime,\n a.accountingendtime,\n concat(a.building,\' \',a.room) as location,\n \'WIFI连接日志\' as DATA_SOURCE,\n  b.ROU_CODE1, b.adaccount,b.LEVEL_CN,b.PRG_NAME_CN,b.DPT_NAME_CN,b.ROU_NAME_CN,\n b.SPR_GEND,b.SPR_DOB,b.ETH_NAME_CN,b.FROM_NAT_NAME,b.FROM_PROVINCE,b.FROM_CITY,b.STU_ISAR,b.STU_IELR,\n   from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as insert_date,\n   a.timestamp_col as timestamps\n from bigdata_dw.wifi_realtime a  left join   (  select ID,CHINESENAME,ENGLISHNAME,ADACCOUNT,MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n from (select a.*, row_number() OVER(PARTITION BY a.adaccount order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where   exists ( SELECT b.id,b.adaccount,count(1) as c\n  FROM bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,b.adaccount\n  having count(1)>1  ) ) h where  h.num=1 union all\nselect ID,CHINESENAME,ENGLISHNAME,nvl(ADACCOUNT,\'未使用\'),MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n from (\n select a.*, row_number() OVER(PARTITION BY a.adaccount order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where  not exists ( \n SELECT b.id,nvl(b.adaccount,\'未使用\') as ad ,count(1) as c\n  FROM  bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,nvl(b.adaccount,\'未使用\')\n  having count(1)>1    ) ) h where  h.num=1 ) b   on rtrim(ltrim(upper(a.username))) = rtrim(ltrim(upper(b.ADACCOUNT))) \n  where b.id is not null', '1', 'HIVE', null, null, null, null, null, null, null, null, null, '2018-06-07 09:25:31', null, null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('288', '1', 'dw_social_contact', null, ' insert overwrite table  bigdata_dw.social_contact\nselect distinct b.* from ( \nselect id,email as student_email,ADD_TEL3,\'学生\' as role  from bigdata_ld.m_student_spr_all\nunion all\nselect  cast(id as string) as id,prs_emad,prs_itel,\'AA导师\' as role from bigdata_eds.aa_list\nunion all\nselect  daaccount as id,concat(DAaccount,\'@xjtlu.edu.cn\') as student_email,officephone,\'DA导师\' as role  from  bigdata_ld.dalist\n\nunion all\nselect concat(\'JY\',cast(id as string)) as id,useremail,mobilephone,\'就业导师\' as role from bigdata_ld.User_Account\n\n) b', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 5 ? * *', null, '2018-06-07 11:45:46', '2018-06-07 11:45:55', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('294', '1', 'dw_risk_count', null, 'insert overwrite  table bigdata_dw.risk_count \nselect  a.student_id,b.adaccount,b.sts_code,\n\ncount(case when a.risk_type like \'%risk_psychology%\' then student_id end) as risk_psychology,\ncount(case when a.risk_type like \'%risk_onestop%\' then student_id end) as risk_onestop,\ncount(case when a.risk_type like \'%risk_dormitory%\' then student_id end) as risk_dormitory,\ncount(case when a.risk_type like \'%risk_other%\' then student_id end) as risk_other,\ncount(case when a.risk_type like \'%risk_contactchange%\' then student_id end) as risk_contactchange,\ncount(case when a.risk_type like \'%risk_exchangedormitory%\' then student_id end) as risk_exchangedormitory,\ncount(case when a.risk_type like \'%risk_inactive%\' then student_id end) as risk_inactive,\ncount(case when a.risk_type like \'%risk_active%\' then student_id end) as risk_active,\ncount(case when a.risk_type like \'%risk_notinschool%\' then student_id end) as risk_notinschool,\ncount(case when a.risk_type like \'%risk_mailfull%\' then student_id end) as risk_mailfull,\nsum(case when a.risk_type like \'%risk_failed%\' then cast(a.risk_description as bigint) else 0 end) as risk_failed,\ncase when a.risk_type like \'%risk_rebuilt%\' then \'Y\' else \'N\' end as risk_rebuilt,\ncount(case when a.risk_type like \'%risk_missingtest%\' then student_id end) as risk_missingtest,\ncount(case when a.risk_type like \'%risk_rank%\' then student_id end) as risk_rank,\ncast(null as string) as obligate\n\n from bigdata_dw.student_risk_history a left join bigdata_dw.dm_student_adaccount  b on a.student_id=b.id\n  join bigdata_ld.date_sta_year d on to_date(a.risk_time)=d.fulldate\nwhere d.sta_year in (select sta_year from bigdata_ld.date_sta_year c where c.fulldate=to_date(from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\')))\n  \n group by a.student_id,b.adaccount,b.sts_code,cast(null as string),\ncase when a.risk_type like \'%risk_rebuilt%\' then \'Y\' else \'N\' end\n having ltrim(rtrim(a.student_id)) is not null  and b.adaccount is not null', '1', 'HIVE', null, null, null, null, null, null, null, '0 40 7 ? * *', null, '2018-06-08 11:17:48', '2018-06-08 11:17:58', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('296', '1', 'dw_student_risk_history_all', null, 'insert into  table bigdata_dw.student_risk_history_all \n\nselect student_id,adaccount,sts_code,risk_psychology,risk_onestop,\nrisk_dormitory,risk_other,risk_contactchange,risk_exchangedormitory,risk_inactive,\nrisk_active,risk_notinschool,risk_mailfull,risk_failed,risk_rebuilt,risk_missingtest,\nrisk_rank,obligate\n from (\n\nselect c.*,row_number() OVER(PARTITION BY c.student_id order by c.risk_rebuilt desc) as num\n\nfrom (\nselect a.student_id ,a.adaccount,a.sts_code,sum(a.risk_psychology) as risk_psychology,\nsum(a.risk_onestop) as risk_onestop,sum(a.risk_dormitory) as risk_dormitory,\nsum(a.risk_other) as risk_other,sum(a.risk_contactchange) as risk_contactchange,\nsum(a.risk_exchangedormitory) as risk_exchangedormitory,sum(a.risk_inactive) as risk_inactive,\nsum(a.risk_active) as risk_active,sum(a.risk_notinschool) as risk_notinschool,\nsum(a.risk_mailfull) as risk_mailfull,sum(a.risk_failed) as risk_failed, a.risk_rebuilt,\nsum(a.risk_missingtest) as risk_missingtest,sum(a.risk_rank) as risk_rank,obligate\n\n \n from bigdata_dw.risk_count a \ngroup by a.student_id ,a.adaccount,a.sts_code,a.risk_rebuilt,a.obligate ) c\n\n) d\nwhere d.num=1', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 8 ? * *', null, '2018-06-08 12:05:50', '2018-06-08 12:05:58', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('297', '1', 'dw_risk_all', null, 'insert overwrite  table bigdata_dw.risk_all  \n\nselect student_id,adaccount,sts_code,obligate,sum(risk_psychology) as risk_psychology,\nsum(risk_onestop) as risk_onestop,sum(risk_dormitory) as risk_dormitory,sum(risk_other) as risk_other,\nsum(risk_contactchange) as risk_contactchange,sum(risk_exchangedormitory) as risk_exchangedormitory,\nsum(risk_inactive) as risk_inactive,sum(risk_active) as risk_active,sum(risk_notinschool) as risk_notinschool,\nsum(risk_mailfull) as risk_mailfull,sum(risk_failed) as risk_failed,risk_rebuilt,\nsum(risk_missingtest) as risk_missingtest,sum(risk_rank) as risk_rank\n\n\n\n from \n(\n \n select student_id,adaccount,sts_code,risk_psychology,risk_onestop,\nrisk_dormitory,risk_other,risk_contactchange,risk_exchangedormitory,risk_inactive,\nrisk_active,risk_notinschool,risk_mailfull,risk_failed,risk_rebuilt,risk_missingtest,\nrisk_rank,obligate\n from (\n\nselect g.*,row_number() OVER(PARTITION BY g.student_id order by g.risk_rebuilt desc) as num\n\nfrom \n \n \n \n(select * from  bigdata_dw.student_risk_history_all a\nunion all \nselect  b.id,\nc.adaccount,c.sts_code,0,0,0,0,0,0,0,b.num,0,0,0,\'N\' as risk_rebuilt,0,0,null as obligate\n\nfrom \nbigdata_dw.active_tj b  left join bigdata_dw.dm_student_adaccount  c on b.id=c.id ) g\n\n) k\nwhere k.num=1\n) j\n\ngroup by student_id,adaccount,sts_code,obligate,risk_rebuilt', '1', 'HIVE', null, null, null, null, null, null, null, '0 20 8 ? * *', null, '2018-06-08 12:18:48', '2018-06-08 12:18:59', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('298', '1', 'dw_dm_student_id_old', null, 'insert overwrite table bigdata_dw.dm_student_id_old \nselect ID,CHINESENAME,ENGLISHNAME,ADACCOUNT,MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n\n from (select a.*, row_number() OVER(PARTITION BY a.id order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where   exists ( SELECT b.id,b.adaccount,count(1) as c\n  FROM bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,b.adaccount\n  having count(1)>1  ) ) h where  h.num=1 union all\nselect ID,CHINESENAME,ENGLISHNAME,nvl(ADACCOUNT,\'未使用\'),MOA_CODE,MOA_SNAM,STS_CODE,STS_NAME,ROU_CODE,ROU_CODE1,LEVEL_CN,PRG_CODE,\nPRG_NAME_CN,PRG_NAME_EN,SCE_OCCL,SCE_BLOK,DPT_CODE,DPT_NAME_CN,DPT_NAME_EN,ROU_NAME_CN,ROU_NAME_EN,SPR_SDATE,SPR_EDATE,SPR_AWDD,SPR_GEND,SPR_DOB,STUDENT_TYPE,\nETH_CODE,ETH_NAME_CN,ETH_NAME_EN,FROM_REGION,STU_NATC,FROM_NAT_NAME,FROM_PROVINCE,FROM_CITY,STU_ISAR,STU_IELR\n from (\n select a.*, row_number() OVER(PARTITION BY a.id order by a.spr_edate desc) as num from bigdata_eds.EDS_M_STUDENT_SPR_ALL a  where  not exists ( \n \n SELECT b.id,nvl(b.adaccount,\'未使用\') as ad ,count(1) as c\n  FROM  bigdata_eds.EDS_M_STUDENT_SPR_ALL b\n  where  a.id=b.id  and a.adaccount=b.ADACCOUNT \n  group by b.id,nvl(b.adaccount,\'未使用\')\n  having count(1)>1    \n   ) \n  ) h where  h.num=1', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 17 ? * *', null, '2018-06-08 14:55:52', '2018-06-08 14:56:01', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('300', '1', 'dw_student_risk', null, 'insert overwrite  table bigdata_dw.student_risk    \n\nselect  a.student_id,a.risk_type,to_date(from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\')) as risk_time,a.risk_degree,a.risk_description\nfrom (select distinct * from bigdata_dw.Risk_uploading where risk_type <>\'risk_active\'  and risk_type not like \'%risk_inactive%\'\nunion all\nselect distinct a.* from bigdata_dw.Risk_uploading a join bigdata_dw.Demension_time  b on to_date(a.risk_time)=b.datekey\n where   a.risk_type like \'%risk_inactive%\'  and (upper(b.weekdescription)=upper(\'Week1\') or upper(b.weekdescription)=upper(\'Week2\')\n or upper(b.weekdescription)=upper(\'Week3\') or upper(b.weekdescription)=upper(\'Week4\') or upper(b.weekdescription)=upper(\'Week5\')\n or upper(b.weekdescription)=upper(\'Week6\') or upper(b.weekdescription)=upper(\'Week7\') or upper(b.weekdescription)=upper(\'Week8\')\n or upper(b.weekdescription)=upper(\'Week9\') or upper(b.weekdescription)=upper(\'Week10\') or upper(b.weekdescription)=upper(\'Week11\')\n or upper(b.weekdescription)=upper(\'Week12\') or upper(b.weekdescription)=upper(\'Week13\') or upper(b.weekdescription)=upper(\'Week14\')\n\n)\n) a', '1', 'HIVE', null, null, null, null, null, null, null, '0 45 6 ? * *', null, '2018-06-14 10:27:29', '2018-06-14 10:27:39', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('301', '1', 'dw_student_risk_old', null, 'insert overwrite table bigdata_dw.student_risk_old       \nselect  a.student_id,a.risk_type,to_date(from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\')) as risk_time,a.risk_degree,a.risk_description\nfrom (select distinct * from bigdata_dw.Risk_uploading where risk_type <>\'risk_active\' and risk_type not like \'%risk_inactive%\'\nunion all\nselect distinct a.* from bigdata_dw.Risk_uploading a join bigdata_dw.Demension_time  b on to_date(a.risk_time)=b.datekey\n where   a.risk_type like \'%risk_inactive%\'  and (upper(b.weekdescription)=upper(\'Week1\') or upper(b.weekdescription)=upper(\'Week2\')\n or upper(b.weekdescription)=upper(\'Week3\') or upper(b.weekdescription)=upper(\'Week4\') or upper(b.weekdescription)=upper(\'Week5\')\n or upper(b.weekdescription)=upper(\'Week6\') or upper(b.weekdescription)=upper(\'Week7\') or upper(b.weekdescription)=upper(\'Week8\')\n or upper(b.weekdescription)=upper(\'Week9\') or upper(b.weekdescription)=upper(\'Week10\') or upper(b.weekdescription)=upper(\'Week11\')\n or upper(b.weekdescription)=upper(\'Week12\') or upper(b.weekdescription)=upper(\'Week13\') or upper(b.weekdescription)=upper(\'Week14\')\n\n)\n) a\n', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 17 ? * *', null, '2018-06-14 10:28:38', '2018-06-14 10:28:47', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('302', '1', 'dw_active_tj', null, 'insert overwrite table bigdata_dw.active_tj  \nselect c.id,count(distinct c.risk_time) as num from (select b.id,\'risk_active\' as risk_type,g.date_time as risk_time ,1 as risk_degree,\n\'统计学年内的活跃天数\' as descreption\n\n from (select * from  bigdata_dw.M_STUDENT_SPR_ALL_zxxs where rou_code1=\'U\' and sts_code=\'C\' or sts_code=\'S\') b \n \njoin (select distinct id,date_time from  bigdata_dw.dm_location_cf) g on b.id=g.id\n) c \n\n join bigdata_ld.date_sta_year d on to_date(c.risk_time)=d.fulldate\nwhere d.sta_year in (select sta_year from bigdata_ld.date_sta_year e where e.fulldate=to_date(from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\')))\n\ngroup by c.id', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 7 ? * *', null, '2018-06-14 10:30:00', '2018-06-14 10:30:09', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('305', '1', 'dw_dm_ztbg', null, 'insert overwrite  table bigdata_dw.dm_ztbg   \nselect distinct bigdata_ld.row_sequence(),a.id,\'学籍状态变更\',a.sts_code as sts_code_new,b.STS_code as STS_code_old,a.sce_occl as sce_occl_old,\nb.sce_occl as sce_occl_new,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\')\n\n\n from \nbigdata_dw.dm_student_id_new a join bigdata_dw.dm_student_id_old b on a.id=b.id \n\n\nwhere (b.sts_code = \'B\' and a.sts_code = \'A\') or (b.sts_code = \'W\' and a.sts_code = \'C\') or (b.sts_code = \'S\' and a.sts_code = \'W\') or (b.sts_code = \'C\' and a.sts_code = \'W\') or (b.sts_code = \'S\' and a.sts_code = \'C\')\n\n', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 5 ? * *', null, '2018-06-14 11:22:55', '2018-06-14 11:23:05', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('306', '1', 'dw_StudentRecord', null, 'insert overwrite table  bigdata_dw.dw_StudentRecord \n\n select case when length(resault) <3 then null else resault end as studentid,RECORD_TYPE,\nREC_FIRSTDATE,\nREC_DONEDATE,\nDANGER_GRADE,\nAC_ADDRESS,\nAC_TITLE,\nAC_BACKINFO,\nAC_MEMO,\nAC_DA,\nroutineid,\nid9,\nrecord_from,\nrisk_type,\ntask_status,\nrisk_starttime,\nywz_feedback,\nestimated_endtime\n from bigdata_ld.StudentRecord a lateral view explode(split(a.studentid,\'\\073\')) adtable as resault\n \n union all\n  select  studentid,RECORD_TYPE,\nREC_FIRSTDATE,\nREC_DONEDATE,\nDANGER_GRADE,\nAC_ADDRESS,\nAC_TITLE,\nAC_BACKINFO,\nAC_MEMO,\nAC_DA,\nroutineid,\nid9,\nrecord_from,\nrisk_type,\ntask_status,\nrisk_starttime,\nywz_feedback,\nestimated_endtime\n from bigdata_ld.StudentRecord \n where studentid is null;', '1', 'HIVE', null, null, null, null, null, null, null, '0 0 4 ? * *', null, '2018-06-14 11:36:09', '2018-06-14 11:36:20', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('307', '1', 'dw_dm_social_student_history_all', null, 'insert into table  bigdata_dw.dm_social_student_history_all \n\nselect id,social_person,social_id,to_date(`time`) as  time ,social_type,social_node,social_status,name from (\nselect id,social_person,social_id,time,social_type,social_node,social_status,name, count(1) as num from \n(select id,social_person,social_id,to_date(`time`) as time ,social_type,social_node,social_status,name from bigdata_dw.dm_social_student a  \nunion all\nselect id,social_person,social_id,to_date(`_c3`) as  time ,social_type,social_node,social_status,name from bigdata_dw.dm_social_student_old  b) c \ngroup by id,social_person,social_id,time,social_type,social_node,social_status,name\nhaving count(1)=1) h', '1', 'HIVE', null, null, null, null, null, null, null, '0 20 6 ? * *', null, '2018-06-14 13:44:14', '2018-06-14 13:44:25', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('308', '1', 'dw_dm_social_student_history', null, 'insert overwrite table bigdata_dw.dm_social_student_history\nselect distinct * from  bigdata_dw.dm_social_student_history_all ', '1', 'HIVE', null, null, null, null, null, null, null, '0 40 6 ? * *', null, '2018-06-14 13:47:38', '2018-06-14 13:47:50', null, null, null, null, '0', null, null, null, null);
INSERT INTO `tb_task` VALUES ('310', '1', 'dw_Risk_uploading', null, 'insert overwrite table bigdata_dw.Risk_uploading   \n--挂科\nselect distinct k.spr_code as student_id,\'risk_failed\' as risk_type,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') as risk_time,1 as risk_degree,\ncast(k.mod_all as string) as risk_description\nfrom \n(\nselect spr_code,ayr_code,smr_cred,smr_rslt,sum(mod_crdt) as mod_all\n\nfrom \n\n (select spr_code,ayr_code,psl_code,mod_code,mod_crdt,smr_cred,smr_rslt, count(1) as num from (\nselect * from \nbigdata_eds.eds_SITS_SMR_FAILURE c  \nunion all\nselect substr(a.spr_code,0,length(a.spr_code)-2),ayr_code,psl_code,mod_code,mod_crdt,smr_cred,smr_rslt from bigdata_ld.SITS_SMR_FAILURE  a) b \ngroup by spr_code,ayr_code,psl_code,mod_code,mod_crdt,smr_cred,smr_rslt\nhaving count(1)=1) h\ngroup by spr_code,ayr_code,smr_cred,smr_rslt) k\n\nunion all\n--留级\nselect k.sce_sjcj as student_id,\'risk_rebuilt\' as risk_type,sce_cred as risk_time,1,concat(\'[时间]:\',nvl(k.sce_cred,\'无\'),\' \' ,\'[ID]:\',nvl(k.sce_sjcj,\'无\')) as reason\nfrom \n(select sce_sjcj,sce_ayrc,sce_begd,sce_endd,sce_cred,count(1)\nfrom \n\n(select substr(a.sce_scjc,0,length(a.sce_scjc)-2) as sce_sjcj,a.sce_ayrc,a.sce_begd,a.sce_endd,a.sce_cred from bigdata_ld.SITS_SCE_XRETAKE  a   \nunion all\nselect b.sce_sjcj,b.sce_ayrc,b.sce_begd,b.sce_endd,b.sce_cred\nfrom bigdata_eds.eds_SITS_SCE_XRETAKE  b) c\ngroup by sce_sjcj,sce_ayrc,sce_begd,sce_endd,sce_cred\nhaving count(1)=1) K\n\nunion all\n--修学\n\nselect p.sab_stuc as student_id,\'risk_suspend\' as risk_type,sab_begd as risk_time,1,p.reason\nfrom (select d.sab_stuc,d.sab_raac,d.sab_begd,d.sab_exrd,d.sab_endd,d.sab_ayrc,concat(\'[时间]:\',nvl(d.sab_begd,\'无\'),\' \',\'[原因]:\',nvl(d.raa_name,\'无\'),\' \',\'[结束时间]:\',nvl(d.sab_endd,\'无\')) as reason,d.sab_udf1,d.sab_udf2,d.sab_udf3,count(1)\nfrom \n(select a.sab_stuc,a.sab_seq2,a.sab_raac,a.sab_begd,a.sab_exrd,a.sab_endd,a.sab_ayrc,b.raa_name,a.sab_udf1,a.sab_udf2,a.sab_udf3\n from bigdata_ld.sits_sab a  left join bigdata_ld.sits_raa b on a.sab_raac=b.raa_code  \nunion all\nselect sab_stuc,sab_seq2,sab_raac,sab_begd,sab_exrd,sab_endd,sab_ayrc,sab_note,sab_udf1,sab_udf2,sab_udf3\nfrom bigdata_eds.eds_t_srs_sab  b)  d\ngroup by d.sab_stuc,d.sab_raac,d.sab_begd,d.sab_exrd,d.sab_endd,d.sab_ayrc,concat(\'[时间]:\',nvl(d.sab_begd,\'无\'),\' \',\'[原因]:\',nvl(d.raa_name,\'无\'),\' \',\'[结束时间]:\',nvl(d.sab_endd,\'无\')),d.sab_udf1,d.sab_udf2,d.sab_udf3\nhaving count(1)=1\nunion all\nselect d.sab_stuc,d.sab_raac,d.sab_begd,d.sab_exrd,d.sab_endd,d.sab_ayrc,       \nconcat(\'[时间]:\',nvl(d.sab_begd,\'无\'),\' \',\'[提醒内容]:\',\'三十天后休学结束\' ,\' \',\'[结束时间]:\',nvl(d.sab_endd,\'无\')) as reason\n,d.sab_udf1,d.sab_udf2,d.sab_udf3,null \nfrom bigdata_eds.eds_t_srs_sab d\nwhere to_date(d.sab_exrd)=date_add(to_date(from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\')),30)) P\n\nunion all\n\n\n--学籍状态改变\n\nselect a.id,\'risk_studentstatuschange\',from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\'),1,\nconcat(\'状态变化：[\',a.sts_name_old,\']\',\'-->[\',a.sts_name_new,\'] \',\'时间:[\',a.\\`_c7\\`,\']\')\n\n\n from bigdata_dw.dm_ztbg  a\n\n--union all\n\n--联系方式变更\n\n--select a.id,\'Contact phone change\',from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\'),1,null  from bigdata_dw.dm_lxdh_bg  a\n\nunion all\n\n--调宿宿舍\n\nselect cast(a.studentid as string) as student_id,\'risk_exchangedormitory\',recorddate,1,\nconcat(\'时间：[\',a.recorddate,\'] \',\'调宿房间号：[\',a.dormid,\'] \',\n\'调换类型:[\',a.change_type,\']\') as descreption\n\n\n from  bigdata_ld.StudentDorm a\nwhere a.bookid not in (select b.bookid from bigdata_eds.eds_StudentDorm b)\n\nunion all\n--缺考记录\n\nselect b.id,\'risk_missingtest\',from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\'),1,\n--concat(\'id:[\',cast(b.id as string),\'] \',\'时间:[ \',a.\\`date\\`,\'] \',\'课程代码:[\',a.module_code,\'] \') \ncast(count(a.id) as string) as descreption\n\n  from bigdata_ld.stu_miss_exam_datas a\nleft join bigdata_dw.dm_student_adaccount b on upper(a.stu_ad)=upper(b.ADACCOUNT)\nwhere dept<>\'Dept.\'\ngroup by b.id,\'risk_missingtest\',from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\'),1\nunion all\n--心理风险\n\nselect a.stu_id,\'risk_psychology\',from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\'),1,\nconcat(\'紧急程度:[\',a.emergency_degree,\'] \',\'背景描述:[\',a.bg_desc,\'] \',\n\'咨询师:[\',a.consultant,\'] \',\'联系人:[\',a.contacts,\'] \',\'联系人邮箱:[\',a.contacts_email,\'] \',\'给DA的建议:[\',a.da_suggest,\'] \') as descreption\n\nfrom bigdata_ld.psychological_counseling   a\nwhere a.stu_id<>\'学生学号\'\nunion all\n\n--宿舍异常\nselect a.stu_1_id,\'risk_dormitory\',from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\'),1,\nconcat(\'[业务操作]:\',a.business_oper,\'\',\'[信息收集时间]:\',a.msg_collect_time,\' \',\'[事件描述]:\',a.event_desc,\' \',\'[联系人]:\',a.contacts,\' \',\'[联系人邮箱]:\',a.contacts_email) \nfrom bigdata_ld.dormitory_manage  a\nwhere a.business_oper<>\'业务操作\'\nunion all\n--一站式上报\nselect a.id,\'risk_onestop\',from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\'),1,\nconcat(\'业务操作:[\',a.business_operation,\'] \',\'信息收集时间:[\',a.collect_time,\'] \',\'事件描述:[\',a.event_description,\n\'] \',\'联系人:[\',a.contacts,\'] \',\'联系人邮箱:[\',a.contacts_email,\'] \') as descreption\n\n\n from bigdata_ld.one_stop_datas    a\nunion all\n--联系电话变更(总的)\nselect a.id,\'risk_contactchange\' as risk_type,a.time,1,concat(\'来源类型:[\',a.source_type,\'] \',\'时间:[\',a.time,\'] \',\'风险描述:[\',\'删除联系方式]\') from bigdata_dw.dm_lxdh_bg_all  a\n\n\n\n\n\nunion all\n\n--邮箱是否已满\n\nselect distinct b.id,\'risk_mailfull\' as risk_type,\n\n\nto_date(case when length(split(last_logon_time,\' \')[0])=8 then concat(substr(split(last_logon_time,\' \')[0],5,4),\'-\',substr(split(last_logon_time,\' \')[0],1,1),\'-\',substr(split(last_logon_time,\' \')[0],3,1))\nwhen length(split(last_logon_time,\' \')[0])=9 and substr(split(last_logon_time,\' \')[0],1,1)<=9 then concat(substr(split(last_logon_time,\' \')[0],6,4),\'-\',substr(split(last_logon_time,\' \')[0],1,1),\'-\',substr(split(last_logon_time,\' \')[0],3,2))\nelse concat(substr(split(last_logon_time,\' \')[0],7,4),\'-\',substr(split(last_logon_time,\' \')[0],1,2),\'-\',substr(split(last_logon_time,\' \')[0],4,2))\nend )\nas last_logon_time,1,\nconcat(\'id:[\',b.id,\'] \',\'时间:[\',c.last_logon_time,\'] \',\'描述：该学生邮箱已满\') as descreption\nfrom \n\n(select substr(a.last_logged_on_user_account,7,50) as adaccount,a.last_logon_time,a.storage_limit_status,a.total_item_size\n\n    from bigdata_ld.email_status_table a  ) c  join bigdata_dw.dm_student_adaccount b on rtrim(ltrim(upper(c.adaccount)))=rtrim(ltrim(upper(b.adaccount)))\n--未活跃度\nunion all\n\nselect b.id,\'risk_inactive\' as risk_type,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') ,1,\n\'14天未活跃学生\' as descreption\n\n from (select * from  bigdata_dw.M_STUDENT_SPR_ALL_zxxs where rou_code1=\'U\' and sts_code=\'C\') b \n \nwhere b.id not in (select id from bigdata_dw.dm_location_cf where date_time>to_date(date_sub(from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\'),14))\nand data_source <> \'ICE签到信息\'\n\n) \n\n--活跃度\n\nunion all\nselect b.id,\'risk_active\' as risk_type,from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\') ,1,\n\'14天活跃学生\' as descreption\n\n from (select * from  bigdata_dw.M_STUDENT_SPR_ALL_zxxs where rou_code1=\'U\' and sts_code=\'C\') b \n \nwhere b.id  in (select id from bigdata_dw.dm_location_cf where date_time>to_date(date_sub(from_unixtime(unix_timestamp(),\'yyyy-MM-dd HH:mm:ss\'),14))) \n', '1', 'HIVE', null, null, null, null, null, null, null, '0 30 6 ? * *', null, '2018-06-14 15:42:32', '2018-06-14 15:42:42', null, null, null, null, '0', null, null, null, null);
