-- ----------------------------
-- Table structure for tb_task
-- ----------------------------
DROP TABLE IF EXISTS `tb_task`;
CREATE TABLE `tb_task` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `account` bigint(20) NOT NULL COMMENT '用户唯一id',
  `task_name` varchar(255) NOT NULL,
  `dependencies` varchar(225) DEFAULT NULL COMMENT '任务依赖任务名称',
  `sql_stc` text CHARACTER SET utf8 COLLATE utf8_unicode_ci COMMENT 'sql语句',
  `task_type` varchar(12) DEFAULT NULL COMMENT '任务类型',
  `sql_type` varchar(12) DEFAULT NULL COMMENT 'sql类型',
  `source_db` varchar(255) DEFAULT NULL COMMENT '来源DB',
  `source_table` varchar(240) DEFAULT NULL COMMENT '来源表名',
  `target_db` varchar(255) DEFAULT NULL COMMENT '目标数据库',
  `target_table` varchar(255) DEFAULT NULL COMMENT '目标表名',
  `field_mapping` text COMMENT '字段映射',
  `filter_condition` varchar(15000) DEFAULT NULL COMMENT '过滤条件',
  `action` varchar(12) DEFAULT NULL COMMENT 'sql语句操作类型（insert,update..）',
  `timer_attribute` varchar(50) DEFAULT NULL COMMENT '定时器属性',
  `notification_id` varchar(20) DEFAULT NULL COMMENT '规则name',
  `createtime` datetime DEFAULT NULL COMMENT '创建时间',
  `updatetime` datetime DEFAULT NULL COMMENT '更新时间',
  `starttime` datetime DEFAULT NULL COMMENT '查询数据起始时间',
  `endtime` datetime DEFAULT NULL COMMENT '查询数据结束时间',
  `partition` varchar(50) DEFAULT NULL COMMENT '源表分区字段',
  `partition_type` varchar(50) DEFAULT NULL COMMENT '增量字段的类型',
  `status` varchar(2) DEFAULT NULL COMMENT '任务状态 0：停止，1执行',
  `remarks` varchar(1000) DEFAULT NULL COMMENT '任务备注',
  `script` text COMMENT '机器学习脚本',
  `data_type` varchar(50) DEFAULT NULL COMMENT 'sqoop任务 数据源类型',
  `num` int(11) DEFAULT NULL COMMENT '任务并行度',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=311 DEFAULT CHARSET=utf8;

